import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/NavBar.css';

const NavBar = () => {
    const navigate = useNavigate();

    const handleNavigate = (path) => {
        navigate(path);
    };

    const handleLogout = () => {
        localStorage.removeItem('token');
        navigate('/login');
    };

    return (
        <div className="navigation-box">
            <div className="nav-icon" onClick={() => handleNavigate('/profile')}>
                <img src="/images/profile.png" alt="Profile" />
            </div>
            <div className="nav-icon" onClick={() => handleNavigate('/stores')}>
                <img src="/images/stores.png" alt="Stores" />
            </div>
            <div className="nav-icon" onClick={() => handleNavigate('/products')}>
                <img src="/images/products.png" alt="Products" />
            </div>
            <div className="nav-icon" onClick={handleLogout}>
                <img src="/images/logout.png" alt="Logout" />
            </div>
        </div>
    );
};

export default NavBar;
